pragma solidity ^0.5.0;

contract SplitwiseGroup {

  uint256 private idCounter = 1;

  struct Group {
    string title;
    address[] participants;
    bool isDeleted;
    bool isActive;
  }

  struct GroupProposal {
    string title;
    address[] participants;
    mapping(address => bool) confirmations;
    mapping(address => bool) addressLedger;
    bool isRejected;
    bool isApproved;
  }

  address deployer;

  mapping(uint256 => GroupProposal) private groupProposals;

  mapping(uint256 => Group) private groups;

  constructor() public {
    deployer = msg.sender;
  }

  function registerGroupProposal(string calldata title, address[] calldata participants) external returns(uint256, address[] memory){
    require(participants.length >= 2);
    require(participants.length <= 50);

    uint256 groupId = idCounter++;
    for(uint8 i = 0; i < participants.length; i++){
      if(!groupProposals[groupId].addressLedger[participants[i]]){
        groupProposals[groupId].participants.push(participants[i]);
        groupProposals[groupId].addressLedger[participants[i]] = true;
        groupProposals[groupId].confirmations[participants[i]] = false;
      }
    }
    groupProposals[groupId].title = title;
    groupProposals[groupId].isRejected = false;
    groupProposals[groupId].isApproved = false;

    return(groupId, groupProposals[groupId].participants);
  }

  function deleteGroup(uint256 groupId) external returns(address[] memory){
    groups[groupId].isDeleted = true;
    groups[groupId].isActive = false;

    return groups[groupId].participants;
  }

  function submitUserParticipation(uint256 groupId, bool confirmation) external returns(uint256, address[] memory, bool, bool){
    //Checking that group proposal has not been discarded or transformed into a group already
    require(!groupProposals[groupId].isRejected, "Already rejected group proposal");
    require(!groupProposals[groupId].isApproved, "Already approved group proposal");

    //Checking that sender is an invited group participant
    uint8 index = getGroupParticipantIndex(groupProposals[groupId].participants, msg.sender);
    require(index < groupProposals[groupId].participants.length, "Not a group participant");

    if(confirmation) return registerParticipantConfirmation(groupId);
    if(!confirmation) return registerParticipantCancellation(groupId, index);
  }

  /*************** PRIVATE FUNCTIONS ****************/

  function registerParticipantConfirmation(uint256 groupId) private returns(uint256, address[] storage, bool, bool){
    groupProposals[groupId].confirmations[msg.sender] = true;

    //Checking wheater it is necessary to create a new group
    if(getGroupProposalConfirmationCount(groupProposals[groupId]) == groupProposals[groupId].participants.length){
      registerNewGroup(groupId, groupProposals[groupId].participants, groupProposals[groupId].title);
      return (groupId, groups[groupId].participants, true, false);
    }
    return (groupId, groups[groupId].participants, false, false);
  }

  function registerParticipantCancellation(uint256 groupId, uint8 index) private returns(uint256, address[] storage, bool, bool){
    groupProposals[groupId].participants = removeGroupParticipantByIndex(groupProposals[groupId].participants, index);
    groupProposals[groupId].confirmations[msg.sender] = false;

    if(groupProposals[groupId].participants.length < 2){
      groupProposals[groupId].isRejected = true;
      return (groupId, groupProposals[groupId].participants, false, true);
    }
    return (groupId, groupProposals[groupId].participants, false, false);
  }

  function registerNewGroup(uint256 groupId, address[] memory participants, string memory title) private returns(uint256){
    //Creating new group
    groups[groupId].participants = participants;
    groups[groupId].title = title;
    groups[groupId].isDeleted = false;
    groups[groupId].isActive = true;
    groupProposals[groupId].isApproved = true;
    return groupId;
  }

  function getGroupProposalConfirmationCount(GroupProposal storage groupProposal) private view returns(uint8){
    uint8 counter = 0;
    for(uint8 i = 0; i < groupProposal.participants.length; i++){
      address participant = groupProposal.participants[i];
      if(groupProposal.confirmations[participant]) counter++;
    }
    return counter;
  }


  /*************** LIBRARY FUNCTIONS ****************/

  function getGroupParticipantIndex(address[] memory participants, address sender) private pure returns(uint8){
    for(uint8 i = 0; i < participants.length; i++){
      if(sender == participants[i]) return i;
    }
    return uint8(participants.length);
  }

  function removeGroupParticipantByIndex(address[] memory participants, uint index) private pure returns(address[] memory) {
        if (index >= participants.length) return participants;

        address[] memory newParticipants = new address[](participants.length - 1);
        for (uint8 i = 0; i < participants.length; i++){
            if(i < index) newParticipants[i] = participants[i];
            if(i > index) newParticipants[i - 1] = participants[i];
        }
        return newParticipants;
  }
}
